    primes = [True] * (R + 1)
    primes[0] = False
    primes[1] = False
    for i in range(2, int(math.sqrt(R)) + 1):
        if primes[i] == True:
            for j in range(i * i, R + 1, i):
                primes[j] = True
    cnt = 0
    for i in range(L, R + 1):
        if primes[i] == True:
            cnt += 1
    return cnt

